INSERT INTO `compro_posts` (`id`, `title`, `slug`, `category`, `content`, `image`, `status`, `user_id`, `created_at`, `updated_at`, `published_at`) VALUES
	(11, 'Pertimbangan Konsumen dalam memilih Ekspedisi', 'pertimbangan-konsumen-dalam-memilih-ekspedisi', NULL, '<p><strong>Kesibukan</strong> yang dialami setiap orang membuat mereka sulit menyempatkan waktunya untuk berbelanja langsung ke toko membeli barang yang diinginkan. Apalagi jarak toko yang cukup jauh menambah kemalasan seseorang untuk memenuhi hasrat berbelanja secara langsung.&nbsp;</p><p><br></p><blockquote>Pada akhirnya, berbelanja secara online adalah solusinya.</blockquote><p><br></p><p>Kepraktisan dan kemudahan yang ditawarkan oleh e-commerce mampu menarik minat para konsumen. Karena tanpa datang langsung ke toko, konsumen sudah bisa memilih barang yang disukai, baik itu melalui media sosial, web maupun melalui aplikasi belanja online yang telah tersedia, seperti shoope, tokopedia, bukalapak, dan lain sebagainya. Dilansir dari Kominfo, di tahun 2020 saja pertumbuhan e-commerce Indonesia sudah mencapai 78 persen.</p><p><br></p><p>Ini berarti pertumbuhan e-commerce Indonesia merupakan yang tertinggi di antara negara-negara lainnya di dunia. Sementara itu, Meksiko membuntuti diperingkat ke dua dengan nilai pertumbuhan 59 persen.&nbsp;Lonjakan yang terjadi terkait penggunaan e-commerce tersebut menunjukkan bahwa konsumen, yaitu sebagian besar masyarakat Indonesia telah bergantung kepada industri ini. Bank Indonesia melalui gubernurnya,</p><p><br></p><p>Perry Warjiyo memproyeksikan bisnis e-commerce Indonesia akan tumbuh sebesar 33,2 persen menjadi 337 triliun pada tahun ini yang mana pada tahun 2020 sudah mencapai 253 triliun. Berbarengan dengan perkembangan e-commerce yang semakin pesat, jasa ekspedisi juga tidak luput menjadi sorotan konsumen.</p><p><br></p><p>Jasa ekspedisi sendiri merupakan suatu jasa yang memberikan pelayanan pengiriman barang baik pengiriman domestik maupun luar negeri.&nbsp;Menurut W-III CARGO, setidaknya saat ini ada 13 jasa ekspedisi terbaik dan terpopuler yang ada di Indonesia antara lain: Pos Indonesia, JNE, J&amp;T Express, TIKI, Wahana, Indah Cargo, Pandu Logistik, Go-kilat, SAP Express Courier, SiCepat, Ninja Express, RPX, dan yang terakhir adalah Go Send.</p><p><br></p><p>Beragamnya pilihan ini memberi keleluasaan bagi konsumen untuk memilih jasa ekspedisi mana yang sesuai dengan kebutuhan mereka. Oleh karena itu, untuk menentukan pilihannya, konsumen memerlukan pertimbangan yang dipengaruhi oleh beberapa faktor dari setiap jasa ekspedisi. Seperti halnya Arandhani, seorang konsumen online shop yang berasal dari kalangan mahasiswa, dalam menentukan jasa ekspedisi dia mempertimbangkan terkait kualitas pelayanan yang diberikan jasa ekspedisi tersebut.&nbsp;Arandhani mengatakan bahwa dia lebih sering menggunakan jasa ekpedisi J&amp;T Express karena menurutnya, di samping harganya yang lebih murah dibandingkan jasa ekspedisi lainnya, J&amp;T Express mampu memberikan layanan yang sesuai dengan kebutuhannya.</p><p><br></p><p>Misalnya, layanan cod tanpa ada patokan atau minimal harga, adanya voucher gratis ongkir, dan keterjangkauan wilayah yang lebih luas. Tidak jauh berbeda dari Arandhani, menurut Rehan sebagai seorang dropshipper, ada 3 alasan utama dalam menentukan jasa ekpedisi, yaitu jasa ekpedisi yang mendukung di wilayahnya, persaingan selisih harga, dan yang terakhir adalah kemauan dari konsumennya sendiri.&nbsp;âBeda lagi kalo semisal buat di market place, shoope, lazada ataupun tokopedia. Disitu saya mencari fasilitas yang lengkap semisal melayani gratis ongkir, ada diskon di hari-hari tertentu, habis itu harganya sendiri contohnya Pos Indonesia (kilat) dan Si Cepat (hemat) itu kan harganya tentu berbeda. Selain itu, secara umum saya memilih jasa kirim yang paling banyak digunakan, kan biasanya J&amp;T sama JNE yang paling sering dipakai orang-orang. Nah itu juga menjadi alasan saya memilih jasa ekspedisi tersebutâ, tambahnya. Dengan demikian, berdasarkan pernyataan dari beberapa narasumber tersebut. Pada dasarnya, pertimbangan konsumen dalam memilih jasa ekspedisi dipengaruhi oleh kualitas pelayanan dari masing-masing jasa ekpedisi itu sendiri. Terkait jasa ekspedisi mana yang dipilih, dikembalikan lagi sesuai dengan selera dan kebutuhan konsumen.&nbsp;Selain itu, kecenderungan memakai jasa ekspedisi tertentu disebabkan karena kenyamanan yang dirasakan konsumen selama menggunakan jasa ekspedisi tersebut. Konten ini telah tayang di Kompasiana.com dengan judul "Pertimbangan Konsumen dalam Memilih Jasa Ekspedisi"</p>', '1660028935_jasa-ekspedisi-terbaik-scaled.jpg', 'PUBLISH', 1, '2022-06-24 09:56:11', '2022-08-09 07:08:55', '2022-08-09 07:08:55'),
	(12, 'Perusahaan Jasa Ekspedisi Dorong Inovasi Produk di Tengah Pandemi', 'perusahaan-jasa-ekspedisi-dorong-inovasi-produk-di-tengah-pandemi', NULL, 'Memasuki awal semester II 2020, SiCepat Ekspres kembali mengeluarkan inovasi produk terbaru yaitu produk GOKIL (Cargo Kilat).\r\n\r\nProduk GOKIL hadir untuk memenuhi berbagai kebutuhan pengiriman komoditi yang lebih bervariasi, dalam jumlah atau ukuran yang lebih besar namun lebih ekonomis dengan harga mulai dari Rp 25 ribu per 10 Kg. Inovasi deretan produk yang telah dikeluarkan oleh SiCepat sebelumnya yaitu H3Lo (Heboh Tiga Kilo), HaLu (Harga Mulai Lima Ribu), dan SIUNTUNG.\r\n\r\nCEO SiCepat Ekspres, The Kim Hai berharap dengan hadirnya Produk GOKIL dapat membantu menggerakkan perekonomian khususnya seller yang menggunakan pengiriman kargo dikala pandemic Covid-19.\r\n\r\nMeskipun produk GOKIL sangat terjangkau, SiCepat Ekspres memastikan bahwa layanan tetap diberikan secara maksimal diantaranya adalah layanan gratis pick up dan cepat sampai.\r\n\r\nâSeller tetap bisa menggunakan layanan gratis pick up untuk Produk GOKIL, dan selama pandemik ini kami tetap melakukan penerapan protokol Kesehatan Covid-19 dengan mewajibkan kurir menggunakan masker dan sarung tangan ketika berinteraksi dengan seller maupun customer, selain itu setiap paket yang masuk HUB wajib melalui proses sterilisasi guna pencegahan penyebaran Covid-19â Ujar The Kim Hai, CEO SiCepat Ekspres.\r\n\r\nProduk GOKIL dapat digunakan untuk Corporate, Social Commerce dan untuk marketplace saat ini tersedia di Tokopedia.Perusahaan yang mendapatkan penghargaan Top CSR of The Year 2020 ini telah mengalami pertumbuhan yang signifikan di tahun 2020 dengan kenaikan rata-rata jumlah shipment di atas 650 ribu paket setiap harinya dan jumlah seller mencapai 1.345.386 yang tersebar di e-commerce dan social commerce.\r\n\r\nSelain itu, kinerja SiCepat ditahun 2020 juga meningkat 110% dengan MoM Growth 4x lipat di setiap bulannya.', '1660028795_645357290.jpg', 'PUBLISH', 1, '2022-08-09 07:06:35', '2022-08-09 07:06:35', '2022-08-09 07:06:35'),
	(13, 'Lima Tips Memilih Ekspedisi yang Tepat untuk Bisnis Online', 'lima-tips-memilih-ekspedisi-yang-tepat-untuk-bisnis-online', NULL, 'Barang tiba tepat waktu dan nggak rusak jadi poin penting bagi konsumen. Itu sebabnya memilih jasa ekspedisi yang tepat bakal membantu kelancaran bisnis online kamu.\r\n\r\nSalah satu momen yang bikin konsumen happy adalah teriakan âpakeeeetâ¦â tepat di depan rumah. Barang yang ditunggu-tunggu pun datang tepat waktu, tepat tujuan, dan tidak rusak. Hati konsumen senang, repeat order pun datang!\r\n\r\nYa, kelancaran pengiriman barang dari online seller ke tangan konsumen ini memang terletak pada jasa ekspedisi. Itu sebabnya memilih ekspedisi yang tepat sangat berpengaruh pada kemajuan bisnis online kamu. \r\n\r\nApa saja yang perlu diperhatikan dalam memilih jasa ekspedisi?\r\n\r\nBanyak Direkomendasikan\r\n\r\nPilih jasa ekspedisi yang terpercaya dan banyak direkomendasikan oleh konsumen atau online seller.\r\n\r\nBuat Perbandingan\r\n\r\nBandingkan beberapa jasa ekspedisi, lihat kelebihan dan kekurangannya. Pilih yang sesuai dengan kebutuhan toko online kamu, misalnya lama pengiriman dan jaminan keamanan saat proses pengiriman barang.\r\n\r\nCek Rute Pengiriman\r\n\r\nJika online shop kamu menerima order dari berbagai daerah, penting untuk memilih jasa ekspedisi yang memiliki banyak rute pengiriman. Soal rute pengiriman ini, teman-teman online seller nggak perlu pusing. JX Indonesia memiliki Distribution Center (DC) yang tersebar di berbagai kota di Indonesia, seperti Jakarta, Semarang, Surabaya, Makassar, Balikpapan, Pontianak, dan Medan. \r\n\r\nAplikasi Tracking\r\n\r\nSistem tracking membantu konsumen untuk memantau sendiri lokasi paket pesanan mereka. Buat online seller sistem ini juga sangat membantu, lho, terutama saat nggak punya waktu membalas pertanyaan konsumen satu per satu. JX Indonesia dilengkapi website dan aplikasi tracking untuk konsumen yang dapat diunduh di PlayStore maupun Apple Store. \r\n\r\nTarif Murah\r\n\r\nPastikan tidak asal murah ya, perhatikan juga service yang ditawarkan apakah menguntungkan bagi toko online kamu dan juga konsumen kamu.', '1660029402_business-owner-working-home-office_1150-11766.jpeg', 'PUBLISH', 1, '2022-08-09 07:16:42', '2022-08-09 07:16:42', '2022-08-09 07:16:42');
